column13:
A pushing vehicle for transporting at least one child, including: 
a wheeled chassis (3) including a chassis frame (4) and a plurality of wheels (6) that are rotatably mounted relative to the chassis frame to support the chassis frame above a ground surface and which enable the chassis to be moved along the ground surface; 
a passenger support (5) for supporting a child; 
wherein the passenger support is attachable to the frame (4) in a mounting position (12) by a single tool-less attachment mechanism for attaching an underside (11) of the passenger support to the chassis frame, to support the passenger support generally above the wheeled chassis, and 
wherein when the seat is detached from the chassis, the seat part (71) and the chassis part (73) of the braking system automatically decouple, and when the seat is attached to the chassis, the seat part and the chassis part of the braking system automatically couple, so that the braking system needs no interaction from a user to separate the parts of the braking system. 
Also described are related modular seating systems and a supporting compartment.

